/** Defines how a tab gap is filled. */
export enum TabLeader {
    /** The tab gap is not filled. */
    None,
    /** The tab gap is filled with periods. */
    Period,
    /** The tab gap is filled with dots. */
    Dot,
    /** The tab gap is filled with dashes. */
    Dash,
    /** The tab gap is underlined. */
    Underline,
}
